window.bookSummaryJSON = "<p>From the author of the <i>New York Times</i> best-selling Undead novels comes a delightfully addictive new series about past lives and bad habits. </p> <p>Leah Nazir is an Insighter. Reincarnation is her business. But while her clients' pasts are a mess, Leah's is nothing short of tragedy. She's been murdered. A lot. If left to that bitch destiny, it'll happen again. Leah wants to know who's been following her through time - and who's been stalking her in the present. </p>"; 
